La sposa abusata (NEW 2014 ATV Entertainment) [DVDRip]

Alexis Crystal , Erik Brummer , Isabella Andreini , Kerry , Lorenzo Miccoli , Micaela Venexiani , Natacha Harris , Nataly Vonn , Sofia , Steve Harlot

Il declino di una societ dove i sentimenti sono sostituiti dall'inarrestabile desiderio di denaro e potere. Giovani mogli, ragazze adolescenti e professioniste dello spettacolo costrette a subire la schiacciante morsa del ricatto da parte di uomini e donne senza scrupoli. Grande ritorno sulle scene di Sofia diretta magistralmente dal maestro dell'erotismo Mario Salieri.

